:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Herbert William and MASON, Bertha Louisa Gertrude
  WILLIAMS, Denys William Wanklyn and THOMSON, Margaret Ann
  04> WILLIAMS, Denys William Wanklyn m on 11.12.1925 to THOMSON, Margaret Ann
  b 01.10.1894 d 11.03.1975
  b 07.03.1890 d 28.03.1983
  Denys b, at Gisborne, m, at Tokomaru Bay and d. at Napier and bd. at Tokomaru Bay.
  Margaret b. at Alloa, Scotland, d. at Gisborne and bd, at Tokomaru Bay.
  Denys was a sheepfarmer on "Ruangarehu" station, Tokomaru Bay, a company director
  and local body member. He was educated at Heretaunga School, Hastings, and
  Wanganui Collegiate School. During WW1 he served in the 9th Wellington Mounted
  Rifles, 1st NZEF and fought at Gallipoli. Denys was chairman of Ruangarehu Ltd
  and a director of the Gisborne Sheepfarmers Mercantile Company and the Gisborne Sheepfarmers Freezing
  Company Ltd. He served on the Waiapu County Council (1929-62, chairman 1932-60), the No 4 District
  Highways Council (1932-75); the Tokomaru Harbour Board (1929-62, deputy chairman 1934-44); the Poverty Bay
  Power Board (1944-50); the Poverty Bay Catchment Board (1945-50); and the Te Puia Domain Board (chairman
  1932-60). He was on the executive of the Gisborne East Coast Regional Planning Council and was a member of
  the Soil Conservation Council and the New Zealand Counties Association (1954-62). In 1953 he was awarded
  the Coronation medal and received the OBE in 1961.
  01> WILLIAMS, William Martyn m on 11.01.1963 to WALLIS, Kathleen Mary
  b 24.09.1927 d 04.06.1984
  b 14.11.1941
  Martyn b. at Gisborne and m. at the Manutuke Anglican Church. Kathleen, d/o Frederick Edgar Bruce
  Wallis and Maida Grace Saunders, b. at Gisborne. Address: PO Box 1225, Nelson.
  Martyn was educated at Dilworth School, Auckland, and trained for farming at Flock House, Bulls. He
  gained farming experience in England (1952-57) and returned to take over the management of "Mangatai"
  Station, Whatatutu, Gisborne, where he remained until his death.
  Kathleen was educated at Patutahi Primary School and Gisborne Girls' High School. After Martyn's death
  she continued with "Mangatai" until the sale of the property in 1989. She then studied at the Bible
  College of New Zealand in 1992-94 (3yr Dip Ministries). She was deaconed at All Saints Church, Nelson,
  on 12 February, 1995 and priested at Christ Church Cathedral, Nelson, on 02 May, 1995. She served as
  assistant priest at All Saints, Nelson in 1995-97 and is presently priest in charge at Golden Bay
  Parish.
  01> WILLIAMS, William Andrew m on 16.03.1991 to SEWELL, Philippa Blackwood
  b 12.08.1964
  b 29.03.1963
  Andrew b, at Gisborne and m. at the Oratia Combined Church, Oratia, Auckland. Address: PO Box 459,
  Таиро.
  Andrew was educated at Whatatutu School, Waikohu College and Edmond Campion College, Gisborne. In
  1981 he completed a course at Flock House Farm Training Institute and won a scholarship to Brooksby
  Agricultural College, Leicestershire, England, which he took up in 1982-83. In 1984 he returned to
  New Zealand and worked in both stock and horticultural farming until 1992. In 1993 Andrew and
  Philippa left Auckland and moved to Taupo, where they established and opened a sporting goods
  retail outlet. Andrew is a keen hunter and sportsman.
  Philippa lived in Rotorua where she completed her primary education at Malfroy Primary School. She
  then moved to Auckland and completed her secondary education at Green Bay High School. At school
  she was a keen and successful sportswoman, holding various athletic and long-distance running
  titles and since school, has been a representative badminton player. She graduated as an Enrolled
  Nurse in 1981 and then as a Registered Comprehensive Nurse in 1991 and has many years of nursing
  experience.
